import { makeStyles } from "@mui/styles";

export const useStyles = makeStyles({
  footer:{
    display:'flex',
    width:'100%',
    justifyContent:'space-between',
    padding:'0 24px',
    marginTop:48
  },
  links:{
    display:'flex',
    float:'right'
  },
  bar:{
    display:'flex',
    marginLeft:96
  },
  firstColunm:{
    display:'flex',
  },
  secondColunm:{
    display:'flex',
    justifyContent:'space-between',
    flexDirection:'column'
  },
  barText:{
    marginBottom:10,
    fontSize:14,
  }
})
